import React from 'react';

const Weather = (props) => {
  return(
    <div>
      <h3>{props.city}</h3>
      <p>{props.description.capitalize()}</p>
      <p>High:{props.high} °F</p>
      <p>Low:{props.low} °F</p>
      <p>Humidity:{props.humidity} %</p>
      <p>Wind Speed:{props.wind} mps</p>
    </div>
  )
}

export default Weather;
